import { Provider } from "react-redux";
import store from "../redux/index";
import withRedux from "next-redux-wrapper";

// need to wrap App with redux-next-wrapper

function App() {
  return (
    <Provider store={store}>
      <h1>Hello world</h1>
    </Provider>
  );
}

export default withRedux(store)(App);
